import React from "react";
import './aboutus.css';
import photo from '../../assets/Screenshot_12.png'

const Aboutus = () => {
    return (
        
        <section class="about"> 
            <div className="ccs__about" >
                <img className="usphoto" src={photo} alt="AboutusImage" className="photo"/> 
                <div class="ccs__about-text">
                    <h1>About the shop</h1>
                    <p> chewy
                    </p>

                </div>
            </div>
        </section>
        
        
        
    )
}
export default Aboutus
